import { useEffect, useState } from "react";
import { getRevenueStats } from "../../services/revenueService";
import "./Dashboard.css";

const Dashboard = () => {
  const [stats, setStats] = useState(null);

  const loadStats = async () => {
    try {
      const res = await getRevenueStats();
      setStats(res.data);
    } catch (err) {
      console.error(err);
    }
  };

  useEffect(() => {
    loadStats();
  }, []);

  return (
    <div className="fq-dashboard">
      <h2>Admin Dashboard</h2>

      <div className="fq-stat-grid">
        <div className="fq-stat-card">Revenue<br/>₹ {stats?.totalRevenue || 0}</div>
        <div className="fq-stat-card">Sales<br/>{stats?.totalSales || 0}</div>
        <div className="fq-stat-card">Active<br/>{stats?.activeCount || 0}</div>
        <div className="fq-stat-card">Expired<br/>{stats?.expiredCount || 0}</div>
      </div>

      <div className="fq-recent">
        <h3>Recent Sales</h3>
        <table className="fq-table">
          <thead>
            <tr>
              <th>Plan</th>
              <th>Amount</th>
              <th>Status</th>
            </tr>
          </thead>
          <tbody>
            {stats?.recentSales?.map((m) => (
              <tr key={m._id}>
                <td>{m.plan?.name}</td>
                <td>₹ {m.plan?.price}</td>
                <td>{m.status}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default Dashboard;
